<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Water Year Similarity Matrix</title>
    <script src="https://cdn.plot.ly/plotly-2.27.0.min.js"></script>
    <style>
        * { box-sizing: border-box; margin: 0; padding: 0; }
        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
            background: #0f172a;
            color: #e2e8f0;
            padding: 20px;
        }
        .container { max-width: 1200px; margin: 0 auto; }
        h1 {
            text-align: center;
            font-size: 1.8rem;
            margin-bottom: 8px;
            color: #38bdf8;
        }
        .subtitle {
            text-align: center;
            color: #94a3b8;
            margin-bottom: 24px;
        }
        .controls {
            display: flex;
            gap: 16px;
            justify-content: center;
            flex-wrap: wrap;
            margin-bottom: 20px;
            padding: 16px;
            background: #1e293b;
            border-radius: 8px;
        }
        .control-group {
            display: flex;
            flex-direction: column;
            gap: 4px;
        }
        .control-group label {
            font-size: 0.75rem;
            color: #94a3b8;
            text-transform: uppercase;
        }
        select {
            padding: 8px 12px;
            font-size: 0.95rem;
            border: 1px solid #334155;
            border-radius: 6px;
            background: #0f172a;
            color: #e2e8f0;
            min-width: 180px;
        }
        .toggle-group { display: flex; gap: 8px; }
        .toggle-btn {
            padding: 8px 16px;
            border: 1px solid #334155;
            border-radius: 6px;
            background: #0f172a;
            color: #94a3b8;
            cursor: pointer;
            font-size: 0.9rem;
        }
        .toggle-btn.active {
            background: #38bdf8;
            color: #0f172a;
            border-color: #38bdf8;
            font-weight: 600;
        }
        #chart { 
            background: #1e293b; 
            border-radius: 8px; 
            padding: 16px;
            min-height: 700px;
        }
        .info {
            background: #1e293b;
            border-left: 3px solid #38bdf8;
            padding: 12px;
            margin-bottom: 16px;
            border-radius: 0 6px 6px 0;
            font-size: 0.9rem;
            color: #94a3b8;
        }
        .stats {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 12px;
            margin-top: 16px;
        }
        .stat-card {
            background: #1e293b;
            padding: 12px;
            border-radius: 6px;
        }
        .stat-card h3 {
            font-size: 0.7rem;
            color: #64748b;
            text-transform: uppercase;
            margin-bottom: 4px;
        }
        .stat-value { color: #38bdf8; font-size: 1rem; }
    </style>
</head>

    <div class="container">
        <h1>Water Year Similarity Matrix</h1>
        <p class="subtitle">N×N correlation matrix comparing water years</p>
        
        <div class="controls">
            <div class="control-group">

            <div class="control-group">

            <div class="control-group">

                <div class="toggle-group">

                </div>
            </div>
        </div>
        
        <div class="info" id="info">Select options to view the similarity matrix.</div>
        
        <div id="chart"></div>

                colorscale: isDistance ? 'YlOrRd' : 'RdBu_r',
                zmin: isDistance ? 0 : -0.3,
                zmax: isDistance ? Math.max(...matrix.flat().filter(v => v !== null)) : 1,
                text: hoverText,
                hoverinfo: 'text',
                colorbar: { title: isDistance ? 'Distance' : 'Similarity' }
            };
            
            const layout = {
                title: {
                    text: currentStation.name + ' - ' + currentMethod.toUpperCase() + ' (' + (currentData === 'delta' ? 'Δ SWE' : 'Raw SWE') + ')',
                    font: { color: '#e2e8f0' }
                },
                xaxis: {
                    title: 'Water Year',
                    tickfont: { size: 10, color: '#94a3b8' },
                    tickangle: -45,
                    gridcolor: '#334155'
                },
                yaxis: {
                    title: 'Water Year',
                    tickfont: { size: 10, color: '#94a3b8' },
                    autorange: 'reversed',
                    gridcolor: '#334155'
                },
                annotations: annotations,
                paper_bgcolor: 'rgba(0,0,0,0)',
                plot_bgcolor: 'rgba(0,0,0,0)',
                height: 700,
                margin: { l: 60, r: 80, t: 60, b: 60 }
            };
            
            Plotly.newPlot('chart', [trace], layout, {responsive: true});
            
            // Update stats
            updateStats(matrix, years, isDistance);
        }
        
        function updateStats(matrix, years, isDistance) {
            let best = { val: isDistance ? Infinity : -Infinity, pair: [] };
            let worst = { val: isDistance ? -Infinity : Infinity, pair: [] };
            
            for (let i = 0; i < years.length; i++) {
                for (let j = i + 1; j < years.length; j++) {
                    const v = matrix[i][j];
                    if (v === null) continue;
                    if (isDistance) {
                        if (v < best.val) { best = { val: v, pair: [years[i], years[j]] }; }
                        if (v > worst.val) { worst = { val: v, pair: [years[i], years[j]] }; }
                    } else {
                        if (v > best.val) { best = { val: v, pair: [years[i], years[j]] }; }
                        if (v < worst.val) { worst = { val: v, pair: [years[i], years[j]] }; }
                    }
                }
            }
            
            document.getElementById('stats').innerHTML = `
                <div class="stat-card">
                    <h3>${isDistance ? 'Most Similar (Min Distance)' : 'Most Similar'}</h3>
                    <div class="stat-value">WY ${best.pair[0]} & WY ${best.pair[1]}</div>
                    <div style="color:#64748b;font-size:0.85rem">${best.val.toFixed(3)}</div>
                </div>
                <div class="stat-card">
                    <h3>${isDistance ? 'Least Similar (Max Distance)' : 'Least Similar'}</h3>
                    <div class="stat-value">WY ${worst.pair[0]} & WY ${worst.pair[1]}</div>
                    <div style="color:#64748b;font-size:0.85rem">${worst.val.toFixed(3)}</div>
                </div>
            `;
        }
        
        // Initial render
        updateChart();
    </script>
</body>
</html>
